import {makeStyles} from '@material-ui/core/styles';

export const useStyles = makeStyles(() => ({
    root: {
        '& h1.title': {
            fontWeight: '400'
        },
        '& div.slider': {
            marginTop: '15px',
            '& div.slick-slide': {
                padding: '14px 7px',
                marginTop: '-14px'
            },
            '& div.slick-list': {
                margin: '0 -6px'
            },
            '& button.slick-prev': {
                left: '-10px'
            },
            '& button.slick-next': {
                right: '-10px'
            },
        }
    }
}));
